import React from 'react';
import Header from './Header';
import Footer from './Footer';
import { BrowserRouter } from 'react-router-dom';

function App() {
  <BrowserRouter>
  return (
      <div>
        <Header />
        {}
        <Footer />
      </div>
  );
  </BrowserRouter>
}

export default App;
